import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

export interface iShema{
    name: 'dark'|'dark1'| 'dark2'|'light'| 'def';
} 
interface iMenu{
    name:string
    linkComp:string
}
let listMenu: Array<iMenu> = [
    {name:'#hmome',linkComp:'Home'},
    {name:'#features',linkComp:'Features'},
    {name:'#pricing',linkComp:'Pricing'},
];

function ColorSchemesExample(props:iShema) {
    const testName:string = 'Home';
    const project = () => {
        switch(props.name) {
          case 'dark': return(
                <Navbar bg="dark" data-bs-theme="dark">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                for (var index in listMenu) {
                 <Nav.Link href="index.name">{testName}</Nav.Link>
                }        
                {/* <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link> */}
                </Nav>
                </Container>
                </Navbar>
          );
          case 'dark1':   return( 
                <Navbar bg="dark" data-bs-theme="dark">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                </Nav>
                </Container>
                </Navbar>
            );
            case 'dark2':   return( 
                <Navbar bg="primary" data-bs-theme="dark">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                </Nav>
                </Container>
                </Navbar>);
            case 'light':   return(
                <Navbar bg="light" data-bs-theme="light">
                <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#features">Features</Nav.Link>
                <Nav.Link href="#pricing">Pricing</Nav.Link>
                </Nav>
                </Container>
                </Navbar>);
          default:      return <h1>No project match</h1>
        }
      }
  return (
    <>
        <div>{ project() }</div>
        {props.name}
    </>
  );
}

export default ColorSchemesExample;
